import React from 'react';
import todos from './todos'

function App() {
  tate = {
    todos: [
      {id: 1, content: 'buy some milk'},
      {id: 2, content: 'play mario kart'}
    ]    
  }
  return (
    <div className="App">
      <h1 className ="center blue-text">Todo's</h1>
      <todos todos={this.state.todos}/>
    </div>
  );
}

export default App;
